void LCDIF_IRQHandler(void) {
    uint32_t status = ELCDIF_GetInterruptStatus(LCDIF);
    ELCDIF_ClearInterruptStatus(LCDIF, status);
    
    if(status&kELCDIF_CurFrameDone) {
        ELCDIF_SetNextBufferAddr(LCDIF, activeFrameAddr);
    }
}

